import React, { useEffect, useState } from 'react';

const MyInfoPage = () => {
  const [userInfo, setUserInfo] = useState({});
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [showLogoutPopup, setShowLogoutPopup] = useState(false);
  const [showWithdrawPopup, setShowWithdrawPopup] = useState(false);

  useEffect(() => {
    fetch('http://localhost:3001/authcheck')
      .then((response) => response.json())
      .then((data) => {
        if (data.isLogin) {
          setIsLoggedIn(true);
          fetchUserInfo();
        } else {
          setIsLoggedIn(false);
        }
      })
      .catch((error) => {
        console.error('서버에서 로그인 상태를 확인하는 동안 오류 발생:', error);
      });
  }, []);

  const fetchUserInfo = () => {
    fetch('http://localhost:3001/myinfo')
      .then((response) => response.json())
      .then((data) => {
        if (data.error) {
          console.log(data.error);
        } else {
          setUserInfo(data);
        }
      })
      .catch((error) => {
        console.error('서버에서 정보를 가져오는 동안 오류 발생:', error);
      });
  };

  const handleLogout = () => {
    if (window.confirm("정말로 로그아웃 하시겠습니까?")) {
      alert("로그아웃 되었습니다.");
    }
  };

  const handleWithdraw = () => {
    if (window.confirm("정말로 회원탈퇴 하시겠습니까?")) {
      alert("회원탈퇴 되었습니다.");
    }
  };

  const confirmLogout = () => {
    alert("로그아웃 되었습니다.");
    setShowLogoutPopup(false);
  };

  const confirmWithdraw = () => {
    alert("회원탈퇴 되었습니다.");
    setShowWithdrawPopup(false);
  };

  return (
    <div>
      <style>
        {`
          /* 스타일 코드 */
        `}
      </style>
      <h1>내 정보</h1>
      {isLoggedIn ? (
        <div>
          <table>
            <thead>
              <tr>
                <th>항목</th>
                <th>내용</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>이름</td>
                <td>{userInfo.name}</td>
              </tr>
              <tr>
                <td>아이디</td>
                <td>{userInfo.username}</td>
              </tr>
              <tr>
                <td>비밀번호</td>
                <td>{userInfo.password}</td>
              </tr>
              <tr>
                <td>생년월일</td>
                <td>{userInfo.birthdate}</td>
              </tr>
              <tr>
                <td>이메일</td>
                <td>{userInfo.email}</td>
              </tr>
              <tr>
                <td>전화번호</td>
                <td>{userInfo.phone}</td>
              </tr>
            </tbody>
          </table>
          <div className="button_container">
            <button className="logout" onClick={handleLogout}>
              로그아웃
            </button>
            <button className="withdraw" onClick={handleWithdraw}>
              회원탈퇴
            </button>
          </div>
        </div>
      ) : (
        <div>
          <p>로그인이 필요합니다.</p>
          {/* 로그인 버튼 또는 로그인 페이지로 이동하는 링크 추가 */}
        </div>
      )}

      {showLogoutPopup && (
        <div className="popup">
          <div className="popup_content">
            <div className="popup_actions">
              <button onClick={confirmLogout}>확인</button>
              <button onClick={() => setShowLogoutPopup(false)}>취소</button>
            </div>
          </div>
        </div>
      )}

      {showWithdrawPopup && (
        <div className="popup">
          <div className="popup_content">
            <div className="popup_actions">
              <button onClick={confirmWithdraw}>확인</button>
              <button onClick={() => setShowWithdrawPopup(false)}>취소</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default MyInfoPage;
